import { useState, userEffect } from "react";

const Import = () => {
  const [IMPort, setIMPort] = useState(null);

  useEffect(() => {
    const { IMP } = window;
    console.log(IMP);
    setIMPort(IMP);
  }, []);

  console.log(IMPort);

  return (
    <>
      <h1>test</h1>
    </>
  );
};

